

class Pad():
    def __init__(self):
        # self.keys = [[1, 2, 3], [4, 5, 6], [7, 8, 9]]
        self.keys = [[None] * 5,
                     [None, None, None, 1, None, None],
                     [None, None,    2, 3, 4,    None],
                     [None,       5, 6, 7, 8, 9, None],
                     [None, None, 'A', 'B', 'C', None],
                     [None, None, None,'D',None, None],
                     [None] * 5]

        self.x = 1
        self.y = 3

    def press(self):
        return self.keys[self.y][self.x]

    def up(self):
        self.y -= 1
        if not self.press():
            self.y += 1
        return self

    def down(self):
        self.y += 1
        if not self.press():
            self.y -= 1
        return self

    def left(self):
        self.x -= 1
        if not self.press():
            self.x += 1
        return self

    def right(self):
        self.x += 1
        if not self.press():
            self.x -= 1
        return self

    def follow(self, str):
        for char in str.strip():
            if char == 'U':
                self.up()
            elif char == 'D':
                self.down()
            elif char == 'L':
                self.left()
            elif char == 'R':
                self.right()
        print(self.press())



code = """



"""

